import React from 'react';

const AdminContacts = () => {
  return (
    <div className="space-y-6">
      <div className="bg-white rounded-xl shadow-sm p-8 text-center">
        <h2 className="text-2xl font-bold text-secondary-900 mb-4">Contact Messages</h2>
        <p className="text-secondary-600">Manage contact form submissions - Coming Soon</p>
      </div>
    </div>
  );
};

export default AdminContacts;
